import Vue from 'vue';
//配置路由
import VueRouter from 'vue-router'
Vue.use(VueRouter);
//1.创建组件
import Index from '@/views/index'
import Home from '@/views/home'
import Login from '@/views/login'
import NotFound from '@/views/404'
import UpdatePassword from '@/views/update-password'
import pay from '@/views/pay'
import register from '@/views/register'
import center from '@/views/center'
    import wodeceping from '@/views/modules/wodeceping/list'
    import xuesheng from '@/views/modules/xuesheng/list'
    import xianshangzixun from '@/views/modules/xianshangzixun/list'
    import discussxinliceping from '@/views/modules/discussxinliceping/list'
    import xinlidaoshi from '@/views/modules/xinlidaoshi/list'
    import zhishileixing from '@/views/modules/zhishileixing/list'
    import storeup from '@/views/modules/storeup/list'
    import discussxinlijiankang from '@/views/modules/discussxinlijiankang/list'
    import cepingbaogao from '@/views/modules/cepingbaogao/list'
    import systemintro from '@/views/modules/systemintro/list'
    import xinliceping from '@/views/modules/xinliceping/list'
    import config from '@/views/modules/config/list'
    import xinlijiankang from '@/views/modules/xinlijiankang/list'


//2.配置路由   注意：名字
const routes = [{
    path: '/index',
    name: '系统首页',
    component: Index,
    children: [{
      // 这里不设置值，是把main作为默认页面
      path: '/',
      name: '系统首页',
      component: Home,
      meta: {icon:'', title:'center'}
    }, {
      path: '/updatePassword',
      name: '修改密码',
      component: UpdatePassword,
      meta: {icon:'', title:'updatePassword'}
    }, {
      path: '/pay',
      name: '支付',
      component: pay,
      meta: {icon:'', title:'pay'}
    }, {
      path: '/center',
      name: '个人信息',
      component: center,
      meta: {icon:'', title:'center'}
    }
      ,{
	path: '/wodeceping',
        name: '我的测评',
        component: wodeceping
      }
      ,{
	path: '/xuesheng',
        name: '学生',
        component: xuesheng
      }
      ,{
	path: '/xianshangzixun',
        name: '线上咨询',
        component: xianshangzixun
      }
      ,{
	path: '/discussxinliceping',
        name: '心理测评评论',
        component: discussxinliceping
      }
      ,{
	path: '/xinlidaoshi',
        name: '心理导师',
        component: xinlidaoshi
      }
      ,{
	path: '/zhishileixing',
        name: '知识类型',
        component: zhishileixing
      }
      ,{
	path: '/storeup',
        name: '我的收藏管理',
        component: storeup
      }
      ,{
	path: '/discussxinlijiankang',
        name: '心理健康评论',
        component: discussxinlijiankang
      }
      ,{
	path: '/cepingbaogao',
        name: '测评报告',
        component: cepingbaogao
      }
      ,{
	path: '/systemintro',
        name: '系统简介',
        component: systemintro
      }
      ,{
	path: '/xinliceping',
        name: '心理测评',
        component: xinliceping
      }
      ,{
	path: '/config',
        name: '轮播图管理',
        component: config
      }
      ,{
	path: '/xinlijiankang',
        name: '心理健康',
        component: xinlijiankang
      }
    ]
  },
  {
    path: '/login',
    name: 'login',
    component: Login,
    meta: {icon:'', title:'login'}
  },
  {
    path: '/register',
    name: 'register',
    component: register,
    meta: {icon:'', title:'register'}
  },
  {
    path: '/',
    name: '系统首页',
    redirect: '/index'
  }, /*默认跳转路由*/
  {
    path: '*',
    component: NotFound
  }
]
//3.实例化VueRouter  注意：名字
const router = new VueRouter({
  mode: 'hash',
  /*hash模式改为history*/
  routes // （缩写）相当于 routes: routes
})
const originalPush = VueRouter.prototype.push
//修改原型对象中的push方法
VueRouter.prototype.push = function push(location) {
   return originalPush.call(this, location).catch(err => err)
}
export default router;
